  false,\n\t\"url\": null,\n\t\"notes\": \"This is a collection of reports on migratory
  birds and marine mammals of the Bristol Bay region for the purpose of facilitating
  the planning process in Bristol Bay. The information will serve as groundwork for
  resource management decisions in the Bristol Bay Cooperative Management Plan and
  in the National Wildlife Refuge Comprehensive Plans. Distribution and abundance,
  life history, biology, critical habitat, nesting, migration, data gaps, and threats
  are discussed, where relevant, for each species in the report.\",\n\t\"license_title\":
